description:
Movie Info: R... Rajkumar (earlier known as Rambo Rajkumar but in movie described as Romeo Rajkumar) is a 2013 Bollywood action-masala film directed by Prabhu Deva and written by Shiraz Ahmed. Produced by Viki Rajani and Sunil Lulla, the film stars Shahid Kapoor and Sonakshi Sinha in lead roles. The theatrical trailer of R... Rajkumar was unveiled on 1 October 2013 on YouTube to positive viewer response. The film released on 6 December 2013, to a negative response from critics,but box office declared it superhit.

